import React, { useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate, useNavigate } from 'react-router-dom';
import './App.css';
import { Navbar } from './components/Navbar/Navbar';

function App() {
  return (
  <Router>
    <Navbar/>
    <Routes>
      <Route path="*" element={<Navigate to="/" />} />
    </Routes>

  </Router>

  );
}

export default App;
